      "text": "فندق عائم",
      "enriched_text": "النشاط: فندق عائم | المصطلحات: نايل كروز, باخرة, نهر النيل, ملاحة نهرية, فندق متحرك | أيضاً يسمى: مركب سياحي, عائمة سياحية, نيل كروز | عند البحث عن: ترخيص فندق عائم, ملاحة سياحية | المتطلبات: ترخيص التشغيل الصادر من وزارة السياحة وما يفيد المستوى السياحي للفندق - تصريح مرور الفندق العائم الصادر من ادارة التراخيص الملاحية بالهيئة العامة للنقل النهري. - ترخيص الملاحة وشهادة الصلاحية الصادرة من الإدارة العامة للتراخيص الملاحية بوزارة النقل للباخرة وقارب الإنقاذ الإنقاذ التابع لها -  رخصة تسيير عائمة سياحية أو نهرية بمجاري الري الصادرة من... | الموقع: موقع الفندق العائم | ملاحظات فنية: 1. التأكد من شهادات سلامة السفينة\\n2. التحقق من تراخيص الطاقم\\n3. التأكد من وجود خطط الطوارئ\\n4. التحقق من جودة خدمات الإعاشة\\n5. مراجعة شهادات نظافة مياه الشرب",
