      "id": "fixed_hotel_establishment",
      "text": "نشاط إنشاء وتشغيل منشأة فندقية ثابتة (فندق / قرية سياحية / شقق فندقية)",
      "enriched_text": "النشاط: نشاط إنشاء وتشغيل منشأة فندقية ثابتة (فندق / قرية سياحية / شقق فندقية) | المصطلحات: بناء فندق, نجومية, تطوير سياحي, إقامة سياحية, قانون 8 لسنة 2022 | أيضاً يسمى: فندق ثابت, مجمع فندقي, شقق فندقية | عند البحث عن: بناء فندق جديد, ترخيص منشأة فندقية, تصنيف نجوم | الإجراءات: إقامة وإدارة منشأة معدة لاستقبال النزلاء وتقديم خدمات الإقامة والوجبات والخدمات الترفيهية، وتصنيفها بنظام النجوم. | المتطلبات: الموافقة المبدئية على الموقع والرسومات (وزارة السياحة)، رخصة بناء سياحي، موافقة الدفاع المدني والصحة، وترخيص تشغيل سياحي نهائي. | الجهة: وزارة السياحة والآثار (قطاع المنشآت الفندقية) بالتعاون مع الهيئة العامة للتنمية السياحية (في حال الأراضي التابعة لها). | الموقع: أرض سياحية أو مبنى مستوفٍ لاشتراطات وزارة السياحة من حيث الموقع والمساحة والخدمات الملحقة. | القانون: قانون المنشآت الفندقية والسياحية رقم 8 لسنة 2022، وقانون الاستثمار رقم 72 لسنة 2017. | الدليل: دليل التراخيص الخاصة بقطاع المنشآت الفندقية والسياحية - قرار 562 لسنة 2019. | ملاحظات فنية: ملاحظات المعاينة الفنية (التصنيف والنجومية):\\n١. كود الحريق: الالتزام الصارم باشتراطات الحماية المدنية الخاصة بالمنشآت الفندقية (رشاشات، مخارج طوارئ).\\n٢. توزيع المساحات:",
