      "enriched_text": "النشاط: نشاط ترخيص وتشغيل فندق عائم (نايل كروز / Floating Hotel) | المصطلحات: نايل كروز, نقل نهري, ملاحة, حماية النيل, بيئة, نهر النيل | أيضاً يسمى: فندق مائي, فندق نهري, مركب سياحي نيل كروز | عند البحث عن: رخصة فندق عائم, تشغيل نايل كروز | الإجراءات: إدارة وتشغيل وحدات فندقية متحركة في المجاري المائية (نهر النيل) تقدم خدمات الإقامة السياحية والبرامج الترفيهية والملاحية. | المتطلبات: ترخيص تشغيل سياحي (وزارة السياحة)، ترخيص ملاحي ساري (هيئة النقل النهري)، شهادة صلاحية هيكل وآلات، رخصة محطة صرف صحي معالجة، وموافقة وزارة الري. | الجهة: وزارة السياحة والآثار بالاشتراك مع الهيئة العامة للنقل النهري ووزارة الموارد المائية والري. | الموقع: المجاري المائية المخصصة للملاحة السياحية (خط القاهرة/أسوان) مع الالتزام بالمراسي المعتمدة رسمياً من وزارة السياحة والري. | القانون: قانون المنشآت الفندقية والسياحية رقم 8 لسنة 2022، قانون الملاحة الداخلية، وقانون حماية نهر النيل من التلوث رقم 48 لسنة 1982. | الدليل: دليل التراخيص الخاصة بقطاع المنشآت الفندقية والسياحية - إصدار هيئة الاستثمار 2019. | ملاحظات فنية: ملاحظات المعاينة الفنية (ملاحية وفندقية):\\n١. الصلاحية الملاحية: معاينة دورية للقاع (Dry Dock) والتأكد من سلامة المحركات وأجهزة التوجيه.\\n٢. السلامة والأمان:",
