      "id": "tourist_restaurant",
      "text": "نشاط ترخيص وتشغيل مطعم أو كافيتريا سياحية (Tourist Restaurant)",
      "enriched_text": "النشاط: نشاط ترخيص وتشغيل مطعم أو كافيتريا سياحية (Tourist Restaurant) | المصطلحات: مطعم, كافيتريا, سياحة, نجوم, سلامة الغذاء, كافيه | أيضاً يسمى: مطعم سياحي, منشأة سياحية, كافيتريا سياحية | عند البحث عن: رخصة مطعم سياحي, تصنيف مطعم | الإجراءات: إنشاء وإدارة منشأة لتقديم المأكولات والمشروبات للجمهور وفقاً للاشتراطات السياحية، مع إمكانية تقديم فقرات فنية. | المتطلبات: ترخيص منشأة سياحية (وزارة السياحة)، شهادة تصنيف سياحي للمطعم، شهادات صحية للعاملين، رخصة حماية مدنية، وموافقة البيئة. | الجهة: وزارة السياحة والآثار (الإدارة المركزية للمنشآت السياحية) بالتنسيق مع وزارة الصحة والداخلية. | الموقع: مبنى مستقل أو جزء من مبنى أو محل تجاري مستوفٍ للمساحات المقررة والمداخل المستقلة حسب درجة التصنيف. | القانون: قانون المنشآت الفندقية والسياحية رقم 8 لسنة 2022، وقانون المحال العامة رقم 154 لسنة 2019. | الدليل: دليل التراخيص الخاصة بقطاع المنشآت الفندقية والسياحية - إصدار 2019. | ملاحظات فنية: ملاحظات المعاينة الفنية وفقاً للدليل:\\n١. المطبخ: يجب أن لا تقل مساحة المطبخ عن نسبة محددة من مساحة الصالة مع توافر أنظمة شفط وتبريد.\\n٢. المخازن:",
