      "id": "tourist_camp",
      "text": "نشاط إنشاء وتشغيل المخيمات السياحية (Camps / Eco-Lodges)",
      "enriched_text": "النشاط: نشاط إنشاء وتشغيل المخيمات السياحية (Camps / Eco-Lodges) | المصطلحات: كامب, سفاري, خيام, بيئة, محمية طبيعية, إيكو لودج | أيضاً يسمى: مخيم سياحي, سياحة بيئية, فندق بيئي | عند البحث عن: رخصة مخيم سياحي, إنشاء كامب سفاري | الإجراءات: إقامة وحدات إقامة غير ثابتة (خيام/أكواخ) في مناطق السفاري والمحميات الطبيعية لتقديم تجربة فندقية بيئية. | المتطلبات: موافقة القوات المسلحة (المناطق الحدودية)، موافقة وزارة البيئة، ترخيص تشغيل سياحي (فئة مخيم)، ورخصة الحماية المدنية. | الجهة: وزارة السياحة والآثار، جهاز شئون البيئة، والجهات الأمنية المختصة. | الموقع: المناطق الصحراوية، الجبلية، والمحميات الطبيعية المعتمدة رسمياً في الخريطة السياحية. | القانون: قانون المنشآت الفندقية والسياحية رقم 8 لسنة 2022، وقانون المحميات الطبيعية رقم 102 لسنة 1983. | الدليل: دليل تراخيص قطاع المنشآت الفندقية والسياحية - إصدار 2019. | ملاحظات فنية: اشتراطات دقيقة للمخيمات:\\n١. مواد البناء: يجب أن تكون من خامات البيئة المحلية وقابلة للفك والتركيب دون إتشار للتربة.\\n٢. الأثر البيئي:",
