      "enriched_text": "النشاط: نشاط إنشاء وتشغيل المناحل وإنتاج عسل النحل وطرود النحل ومنتجات الخلية المختلفة | المصطلحات: منحل, عسل نحل, حبوب لقاح, غذاء ملكات, شمع نحل, طرود نحل, نحل كرنيولي | أيضاً يسمى: تربية نحل, إنتاج العسل, منحل تجاري | عند البحث عن: ترخيص منحل رسمي, إنتاج عسل نحل, بيع طرود نحل | الإجراءات: تربية نحل العسل لإنتاج العسل، حبوب اللقاح، غذاء الملكات، شمع النحل، وإنتاج طرود النحل والملكات الملقحة للأغراض التجارية. | المتطلبات: ترخيص تشغيل منحل (قطاع تنمية الثروة الحيوانية)، سجل قيد المنحل، موافقة قسم بحوث النحل بمركز البحوث الزراعية، ومحضر معاينة فنية للموقع. | الجهة: وزارة الزراعة (قطاع تنمية الثروة الحيوانية والداجنة) بالتنسيق مع معهد بحوث وقاية النباتات. | الموقع: الأراضي الزراعية والمساحات الغنية بالمراعي الزهرية مع الالتزام بمسافات البعد الوقائي عن المناحل الأخرى لضمان عدم التداخل وسلامة الطوائف. | القانون: القرارات الوزارية المنظمة لتربية النحل وتداول منتجاته، والضوابط الفنية الصادرة عن قسم بحوث النحل بوزارة الزراعة. | الدليل: دليل تراخيص قطاع تنمية الثروة الحيوانية والداجنة - بند تشغيل المناحل. | ملاحظات فنية: اشتراطات الدقة المتناهية وفقاً للدليل:\\n١. البعد الوقائي: ضرورة الالتزام بالمسافات الفنية بين المنشآت النحلية (المناحل) لضمان كفاية المرعى الزهري ومنع انتقال الأمراض الطفيلية.\\n٢. الحالة الصحية:",
