      "enriched_text": "النشاط: نشاط بيع وتداول الأدوية البيطرية | المصطلحات: أدوية بيطرية, صيدلية بيطرية, علاج حيوانات, هيئة الخدمات البيطرية, مربين, تداول أدوية | أيضاً يسمى: بيع أدوية حيوانات, مركز أدوية بيطرية, تجارة الأدوية البيطرية | عند البحث عن: ترخيص مركز بيع أدوية بيطرية, فتح صيدلية بيطرية, تجارة العلاجات البيطرية | الإجراءات: فتح مركز لبيع وتداول الأدوية البيطرية للمربين والجهات المعنية. | المتطلبات: ترخيص مركز بيع وتداول الأدوية البيطرية. | الجهة: الهيئة العامة للخدمات البيطرية - الإدارة المركزية للخدمات والإرشاد البيطري. | الموقع: أماكن ذات صلاحية للأنشطة التجارية والصيدلانية، مع مراعاة الشروط الصحية والتخزينية. | القانون: القرار الوزاري رقم 1834 لسنة 2000 وقرار مجلس الإدارة بجلسة 2023/6/4. | الدليل: دليل تراخيص وزارة الزراعة واستصلاح الأراضي - الهيئة العامة للخدمات البيطرية. | ملاحظات فنية: اشتراطات الدقة المتناهية وفقاً للدليل:\\n١. المدير المسؤول: يجب أن يكون طبيباً بيطرياً مصرياً مرخصاً له، مسجلاً في نقابة الأطباء البيطريين وفي السجل الخاص بالهيئة.\\n٢. الموقع:",
