      "enriched_text": "النشاط: نشاط بيع وتداول المستحضرات البيولوجية البيطرية | المصطلحات: لقاحات بيطرية, أمصال, سلسلة تبريد, مستحضرات بيولوجية, تحصين مواشي, بيولوجي بيطري | أيضاً يسمى: بيع لقاحات حيوانية, تجارة الأمصال البيطرية, مركز مستحضرات حيوية بيطرية | عند البحث عن: ترخيص بيع لقاحات بيطرية, تجارة الأمصال, حفظ المستحضرات البيولوجية | الإجراءات: فتح مركز لبيع وتداول المستحضرات البيولوجية البيطرية (كاللقاحات والأمصال). | المتطلبات: ترخيص مركز بيع وتداول المستحضرات البيولوجية البيطرية. | الجهة: الهيئة العامة للخدمات البيطرية - الإدارة المركزية للخدمات والإرشاد البيطري. | الموقع: أماكن ذات صلاحية للأنشطة التجارية والصيدلانية، مع مراعاة الشروط الصحية والتخزينية الدقيقة للمستحضرات البيولوجية. | القانون: القرار الوزاري رقم 1616 لسنة 2000 وقرار مجلس الإدارة بجلسة 2023/6/4. | الدليل: دليل تراخيص وزارة الزراعة واستصلاح الأراضي - الهيئة العامة للخدمات البيطرية. | ملاحظات فنية: اشتراطات الدقة المتناهية وفقاً للدليل:\\n١. المدير المسؤول: يجب أن يكون طبيباً بيطرياً مصرياً مرخصاً له، مسجلاً في نقابة الأطباء البيطريين وفي السجل الخاص بالهيئة.\\n٢. الموقع:",
