      "id": "vet_clinic_medicine",
      "text": "نشاط عيادة بيطرية تستخدم أدوية بيطرية",
      "enriched_text": "النشاط: نشاط عيادة بيطرية تستخدم أدوية بيطرية | المصطلحات: عيادة بيطرية, كشف بيطري, علاج حيوانات, نقابة الأطباء البيطريين, صيدلية عيادة, مزاولة مهنة | أيضاً يسمى: مكتب بيطري, عيادة حيوانات, مركز علاج بيطري | عند البحث عن: ترخيص عيادة بيطرية أدوية, تسجيل منشأة بيطرية, فتح عيادة حيوانات أليفة | الإجراءات: إنشاء وتشغيل عيادة بيطرية تقوم بتشخيص وعلاج الحيوانات باستخدام الأدوية البيطرية. | المتطلبات: ترخيص استعمال أدوية بيطرية داخل عيادة بيطرية، شهادة تسجيل المنشأة البيطرية بالنقابة العامة للأطباء البيطريين. | الجهة: الهيئة العامة للخدمات البيطرية - الإدارة المركزية للخدمات والإرشاد البيطري. | الموقع: مكان مناسب للعيادات البيطرية وفق موافقة الجهة المحلية (الحي)، مع تخصيص مناطق للكشف والصيدلة والتخزين. | القانون: القرار الوزاري رقم 1831 لسنة 2000 وقرار مجلس الإدارة بجلسة 2023/6/4. | الدليل: دليل تراخيص وزارة الزراعة واستصلاح الأراضي - الهيئة العامة للخدمات البيطرية. | ملاحظات فنية: اشتراطات الدقة المتناهية وفقاً للدليل:\\n١. الطبيب البيطري: يجب أن يكون مصري الجنسية، مرخصاً له بمزاولة المهنة، مقيداً في سجلات نقابة الأطباء البيطريين، حسن السير والسلوك،",
