      "text": "نشاط مركز متكامل لبيع وتداول الأدوية والمستحضرات البيولوجية البيطرية",
      "enriched_text": "النشاط: نشاط مركز متكامل لبيع وتداول الأدوية والمستحضرات البيولوجية البيطرية | المصطلحات: مركز متكامل, تداول أدوية, بيع لقاحات, مركز بيطري شامل, تنمية حيوانية, تجارة بيطرية | أيضاً يسمى: مجمع أدوية وبيولوجيات بيطرية, مركز توزيع بيطري معتمد | عند البحث عن: ترخيص مركز بيطري متكامل, تداول أدوية ولقاحات معاً, فتح مركز توزيع بيطري | الإجراءات: إنشاء مركز متكامل لبيع وتداول كلاً من الأدوية البيطرية والمستحضرات البيولوجية البيطرية (اللقاحات والأمصال). | المتطلبات: ترخيص مركز بيع وتداول الأدوية البيطرية، ترخيص مركز بيع وتداول المستحضرات البيولوجية البيطرية. | الجهة: الهيئة العامة للخدمات البيطرية - الإدارة المركزية للخدمات والإرشاد البيطري. | الموقع: مكان تجاري مناسب ذو مساحة كافية لتخصيص مناطق منفصلة لتخزين الأدوية والمستحضرات البيولوجية بشروطها المختلفة. | القانون: القرار الوزاري رقم 1831 لسنة 2000 وقرار مجلس الإدارة بجلسة 2023/6/4، القرار الوزاري رقم 1661 لسنة 2000 وقرار مجلس الإدارة بجلسة 2023/6/4. | الدليل: دليل تراخيص وزارة الزراعة واستصلاح الأراضي - الهيئة العامة للخدمات البيطرية. | ملاحظات فنية: اشتراطات الدقة المتناهية وفقاً للدليل:\\n١. المدير المسؤول: يجب أن يكون طبيباً بيطرياً مصرياً مرخصاً له، مسجلاً في نقابة الأطباء البيطريين وفي السجل الخاص بالهيئة.\\n٢. الموقع:",
