      "id": "groundwater_well_drilling",
      "text": " حفر واستغلال بئر مياه جوفية (Groundwater Well License)",
      "enriched_text": "النشاط:  حفر واستغلال بئر مياه جوفية (Groundwater Well License) | المصطلحات: بئر مياه, مياه جوفية, حفر آبار, وزارة الري, دراسة هيدروجيولوجية, مقنن مائي | أيضاً يسمى: ترخيص بئر, استخراج مياه جوفية, بئر ارتوازي | عند البحث عن: طلب حفر بئر مياه جوفية, رخصة بئر زراعي, تقنين وضع بئر مياه | الإجراءات: الحصول على ترخيص قانوني لحفر بئر جوفي واستخراج المياه لاستخدامها في الأغراض (الصناعية، الزراعية، أو مياه الشرب) ضمن نطاق محدد. | المتطلبات: ترخيص حفر بئر (وزارة الري)، موافقة جهة الولاية على الأرض، دراسة هيدروجيولوجية معتمدة، ومحضر معاينة فنية من الإدارة العامة للمياه الجوفية. | الجهة: وزارة الموارد المائية والري (قطاع المياه الجوفية - الإدارة العامة للمياه الجوفية بالمنطقة المختصة). | الموقع: داخل حيز الأرض التي لها جهة ولاية معتمدة، ويشترط الالتزام بالإحداثيات (GPS) المحددة في الموافقة الفنية. | القانون: قانون الموارد المائية والري رقم 147 لسنة 2021 (المواد المتعلقة بالمياه الجوفية)، واللائحة التنفيذية للقانون. | الدليل: الدليل الإرشادي لخدمات قطاع المياه الجوفية (إصدار يناير 2020). | ملاحظات فنية: اشتراطات المعاينة الفنية وفقاً للدليل:\\n١. جهة الولاية: يجب تقديم طلب معتمد من (هيئة التنمية الصناعية، أو هيئة التعمير، أو المحافظة) حسب تبعية الأرض.\\n٢. المسافات البينية:",
