      "id": "petroleum_and_oil_services",
      "text": "أنشطة البحث عن البترول والخدمات البترولية",
      "enriched_text": "النشاط: أنشطة البحث عن البترول والخدمات البترولية | المصطلحات: بترول, غاز, استكشاف, حفر آبار بترول, EGPC, خدمات بترولية, مناطق امتياز | أيضاً يسمى: البحث والتنقيب, قطاع البترول, شركات البترول | عند البحث عن: ترخيص خدمات بترولية, اتفاقية بحث واستكشاف, إنشاء محطة وقود | الإجراءات: أنشطة البترول: تشمل البحث والاستكشاف عن البترول، الخدمات البترولية المساندة لعمليات الحفر، وإنشاء وتشغيل محطات الوقود (منافذ التسويق). | المتطلبات: الحصول على موافقة الهيئة المصرية العامة للبترول، وصدور قانون خاص لاتفاقيات البحث والاستكشاف. | الجهة: وزارة البترول والثروة المعدنية - الهيئة المصرية العامة للبترول (EGPC). | الموقع: مناطق الامتياز المحددة في الاتفاقيات، أو المواقع المستوفية لاشتراطات محطات الوقود (المساحات، المسافات البينية، والموافقات الأمنية). | القانون: - القانون رقم 66 لسنة 1953 بشأن المناجم والمحاجر. \\n- القانون رقم 198 لسنة 2014 (قانون الثروة المعدنية). \\n- اتفاقيات الالتزام الصادرة بقوانين خاصة لكل منطقة بحث. | الدليل: دليل الهيئة المصرية العامة للبترول | ملاحظات فنية: يوصى بالتركيز على الضوابط الفنية والميدانية التالية عند معاينة المنشآت والأنشطة البترولية:\\n1. علامات الاستدلال (Boundary Markers): التأكد من إقامة علامة تحديد مبدئية ثابتة بمنطقة الامتياز.\\n2.",
