      "enriched_text": "النشاط: إنشاء وتشغيل المخابز (البلدية / السياحية / الإفرنجية) ومحلات الحلوى | المصطلحات: مخبز, عيش بلدي, خبز مدعم, وزارة التموين, فرن, دقيق تمويني, حلواني | أيضاً يسمى: مخبز سياحي, فرن عيش, مخبز إفرنجي | عند البحث عن: ترخيص مخبز بلدي, فتح محل حلويات, رخصة مخبز سياحي | الإجراءات: إنشاء وتشغيل المخابز البلدية لإنتاج الخبز المدعم (نصف آلي / آلي) أو المخابز السياحية والإفرنجية لإنتاج الخبز الحر والفينو ومحلات الحلوى، وفقاً للمواصفات الفنية المعتمدة بالدليل. | المتطلبات: الموافقة المبدئية على البدء في إجراءات الإنشاء (وزارة التموين والتجارة الداخلية)، رخصة بناء أو تشغيل (المحليات)، شهادة صحية للعاملين (وزارة الصحة)، والموافقة النهائية على مزاولة النشاط (وزارة التموين والتجارة الداخلية). | الجهة: اللجنة العليا للمخابز بوزارة التموين. | الموقع: داخل الحيز العمراني، ويشترط ألا تقل المساحة عن ٦٥ متراً للمخبز البلدي، وأن يكون الارتفاع لا يقل عن ٤ أمتار، مع توافر فتحات تهوية وإضاءة كافية ومصدر مياه دائم وصرف صحي. \\n- يجب أن يكون المخبز على طريق رئيسي ممهد لاستلام الخامات وتصريف الانتاج. | القانون: القرار الوزاري رقم 66 لسنة 2002 بشأن قواعد إنشاء المخابز البلدية الجديدة ومستودعات بيع الدقيق.\\n-   القرار الوزاري رقم 155 لسنة 2018م بشأن انشاء المخابز البلدية لانتاج الخبز البلدى المدعم الذي يتم بيعة بموجب البطاقة التموينية . | الدليل: دليل وزارة التموين | ملاحظات فنية: المواصفات الفنية وفقاً للدليل:\\n١. المساحة: لا تقل عن ٦٥م٢ للمخبز البلدي بارتفاع ٤م.\\n٢. الحوائط: مغطاة بالسيراميك من الأرض حتى السقف.\\n٣. التجهيزات: وجود مدخنة تعلو عن سطح العقار بمقدار ٢م،",
