      "id": "medical_importers_registry",
      "text": "نشاط استيراد المستحضرات والمستلزمات الطبية (سجل المستوردين)",
      "enriched_text": "النشاط: نشاط استيراد المستحضرات والمستلزمات الطبية (سجل المستوردين) | المصطلحات: استيراد أدوية, سجل المستوردين, هيئة الدواء, مستلزمات طبية, إفراج جمركي أدوية, Import Permit | أيضاً يسمى: شركة استيراد دوائي, مستورد مستحضرات طبية, وكيل أدوية مستوردة | عند البحث عن: قيد في سجل المستوردين بهيئة الدواء, استيراد مواد خام دوائية, ترخيص شركة استيراد مستلزمات طبية | الإجراءات: استيراد المستحضرات الطبية والمواد الخام من الخارج وتداولها بالسوق المصري، ويسمح الدليل بالجمع بين هذا النشاط ونشاط التصنيع لدى الغير في مقر إداري واحد. | المتطلبات: إخطار قيد بسجل المستوردين (EDA)، شهادة قيد بسجل المستوردين (وزارة التجارة)، شهادة الاشتراك في شعبة الأدوية، وبيان قيد وترخيص مزاولة مهنة للمدير الصيدلي المسؤول. | الجهة: هيئة الدواء المصرية (الإدارة المركزية للعمليات - الإدارة العامة لتراخيص قيد سجل المستوردين وشركات التصنيع لدى الغير). | الموقع: مقر إداري منفصل يقع داخل نطاق المدن والمراكز. | القانون: قانون إنشاء هيئة الدواء المصرية رقم 151 لسنة 2019، وقانون سجل المستوردين رقم 121 لسنة 1982 وتعديلاته. | الدليل: الدليل التنظيمي لقواعد قيد الشركات بسجل شركات التصنيع لدى الغير | ملاحظات فنية: ملاحظات المعاينة الفنية:\\n١. المقر المشترك: يسمح بالجمع بين الاستيراد والتصنيع لدى الغير في مقر واحد بشرط الفصل الإداري.\\n٢. الرقابة:",
