      "text": "أعمال المقاولات والتشييد والبناء",
      "enriched_text": "النشاط: أعمال المقاولات والتشييد والبناء | المصطلحات: مقاولات, اتحاد المقاولين, تشييد, بناء, طرق وكباري, سكك حديدية, إسكان | أيضاً يسمى: شركة مقاولات, أعمال بناء, منشآت مدنية | عند البحث عن: قيد في اتحاد المقاولين, ترخيص شركة مقاولات, تنفيذ مشروعات تشييد | الإجراءات: أعمال التشييد والبناء: تشمل تنفيذ المباني، الطرق، الكباري، السكك الحديدية، محطات المياه والصرف، الأشغال العامة، والتركيبات المعدنية والكهربائية والميكانيكية. | المتطلبات: القيد والتصنيف بالاتحاد المصري لمقاولي التشييد والبناء (بطاقة العضوية السارية) وفقاً للفئة النوعية والمالية. | الجهة: الاتحاد المصري لمقاولي التشييد والبناء (EFCBC). | الموقع: المقر الإداري للشركة بالإضافة إلى مواقع العمل الإنشائية الميدانية. | القانون: - قانون رقم 104 لسنة 1992 بإنشاء الاتحاد المصري لمقاولي التشييد والبناء. \\n- القرار الوزاري رقم 205 لسنة 1993 بإصدار اللائحة التنفيذية للقانون. | الدليل: دليل الاتحاد المصرى لمقاولي التشييد والبناء 2025 | ملاحظات فنية: يوصى بالتركيز على النقاط التالية:\\n1. الكيان القانوني والمقر: التأكد من وجود مقر إداري ثابت.\\n2. الجهاز الفني: التحقق من شهادات قيد المهندسين وتفرغهم.\\n3. المعدات والآلات:",
