      "id": "agricultural_sorting_packing",
      "text": "إنشاء محطات فرز وتعبئة الحاصلات الزراعية (وزارة التموين)",
      "enriched_text": "النشاط: إنشاء محطات فرز وتعبئة الحاصلات الزراعية (وزارة التموين) | المصطلحات: تعبئة زراعية, فرز حاصلات, وزارة التموين, حاصلات زراعية, سجل صناعي, إدارة الحاصلات | أيضاً يسمى: محطة فرز وتعبئة, تجهيز حاصلات زراعية | عند البحث عن: ترخيص محطة تعبئة زراعية تموينية, إنشاء محطة فرز خضروات وفاكهة | الإجراءات: إقامة وتشغيل محطات لفرز وتعبئة الحاصلات الزراعية . | المتطلبات: الموافقة المبدئية على البدء في إجراءات الإنشاء (وزارة التموين)، رخصة تشغيل منشأة (الهيئة العامة للتنمية الصناعية)، شهادة السجل الصناعي (التنمية الصناعية). | الجهة: لجنة من الإدارة العامة للحاصلات الزراعية - وزارة التموين . | الموقع: المناطق الصناعية أو الأراضي المستوفاة لاشتراطات وزارة الزراعة. | القانون: المرسوم بقانون 95 لسنة 1945، وقانون تيسير إجراءات منح تراخيص المنشآت الصناعية رقم 15 لسنة 2017. | الدليل: الدليل- وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية للمحطات:\\n1. المسار التصنيعي: التأكد من عدم تداخل المسارات.\\n2. التجهيزات: توافر سيور الفرز وماكينات التدريج.\\n3. التحكم البيئي: توافر اشتراطات التهوية ومنع دخول الحشرات.\\n4.",
