      "id": "agricultural_drying_stations",
      "text": "إنشاء محطات تجفيف الحاصلات الزراعية (وزارة التموين)",
      "enriched_text": "النشاط: إنشاء محطات تجفيف الحاصلات الزراعية (وزارة التموين) | المصطلحات: تجفيف خضروات, تجفيف فاكهة, محطة تجفيف, وزارة التموين, مناشر شمسية, رطوبة | أيضاً يسمى: مصنع تجفيف زراعي, تجفيف الحاصلات | عند البحث عن: ترخيص محطة تجفيف زراعية, بدء نشاط تجفيف الفواكه والخضروات | الإجراءات: إقامة وتشغيل محطات متخصصة في تجفيف الحاصلات الزراعية (خضروات، فاكهة) . | المتطلبات: الموافقة المبدئية على البدء في إجراءات الإنشاء (وزارة التموين)، رخصة تشغيل منشأة (الهيئة العامة للتنمية الصناعية)، شهادة السجل الصناعي (التنمية الصناعية). | الجهة: لجنة من الإدارة العامة للحاصلات الزراعية - وزارة التموين . | الموقع: المناطق الصناعية أو المواقع المستوفاة لاشتراطات حماية الأراضي. | القانون: المرسوم بقانون 95 لسنة 1945، وقانون رقم 15 لسنة 2017. | الدليل: الدليل- وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية لمحطات التجفيف:\\n1. منطقة الاستلام: توافر مساحة نظيفة لاستلام الخام.\\n2. وحدات التجفيف: معاينة الأنفاق الحرارية أو المناشر.\\n3. التحكم في الرطوبة: وجود أجهزة قياس دقيقة.\\n4.",
