      "text": "إنشاء ثلاجات حفظ الحاصلات الزراعية والمنتجات الغذائية (وزارة التموين)",
      "enriched_text": "النشاط: إنشاء ثلاجات حفظ الحاصلات الزراعية والمنتجات الغذائية (وزارة التموين) | المصطلحات: ثلاجات حفظ, تخزين مبرد, مخزن تبريد, ساندوتش بانل, سلامة الغذاء, تخزين استراتيجي | أيضاً يسمى: مستودع تبريد, ثلاجة تخزين غذائي | عند البحث عن: ترخيص ثلاجة تبريد حاصلات, إنشاء مخزن مبرد للمواد الغذائية, تسجيل منشأة تخزين غذائي | الإجراءات: إنشاء وإدارة مخازن مبردة (ثلاجات) متخصصة في حفظ الحاصلات الزراعية والمواد الغذائية الخام والمصنعة تحت درجات حرارة محكومة. | المتطلبات: الموافقة المبدئية (وزارة التموين)، رخصة تشغيل صناعية (IDA)، سجل صناعي، وشهادة تسجيل بالهيئة القومية لسلامة الغذاء. | الجهة: وزارة التموين والتجارة الداخلية بالاشتراك مع الهيئة القومية لسلامة الغذاء. | الموقع: المناطق الصناعية أو المواقع المستوفاة لاشتراطات حماية الأراضي. | القانون: المرسوم بقانون 95 لسنة 1945، وقانون رقم 15 لسنة 2017. | الدليل: الدليل - وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية للثلاجات:\\n1. كفاءة التبريد: معاينة العزل الحراري (الساندوتش بانل).\\n2. التخزين: توافر طليات خشبية أو بلاستيكية ومنع ملامسة الأرض.\\n3. السلامة:",
