      "text": "إنشاء وتشغيل معاصر الزيوت النباتية (وزارة التموين)",
      "enriched_text": "النشاط: إنشاء وتشغيل معاصر الزيوت النباتية (وزارة التموين) | المصطلحات: معصرة زيوت, زيت طعام, تكرير زيوت, بذور زيتية, سلامة الغذاء, تعبئة زيوت | أيضاً يسمى: مصنع زيوت نباتية, استخلاص الزيت | عند البحث عن: ترخيص معصرة زيت نباتي, إنشاء خط تكرير وتعبئة زيوت, إنتاج زيت الطعام | الإجراءات: إنشاء وتشغيل معاصر لاستخلاص الزيوت من البذور الزيتية وتكريرها وتعبئتها، لضمان توفير زيوت الطعام. | المتطلبات: الموافقة المبدئية (وزارة التموين)، رخصة تشغيل صناعية غذائية (IDA)، سجل صناعي، وشهادة مطابقة سلامة الغذاء. | الجهة: وزارة التموين والتجارة الداخلية بالتعاون مع الهيئة العامة للتنمية الصناعية. | الموقع: المناطق الصناعية المعتمدة مع توافر منظومات معالجة الصرف الصناعي. | القانون: المرسوم بقانون 95 لسنة 1945، وقانون رقم 15 لسنة 2017. | الدليل: الدليل- وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية لمعاصر الزيوت:\\n1. خط الإنتاج: معاينة وحدات عصر البذور وغلايات التكرير.\\n2. التخزين: توافر صهاريج ستانلس ستيل مطابقة للمواصفات.\\n3. السلامة البيئية:",
