      "text": "إنشاء وتشغيل مراكز توزيع البوتاجاز (وزارة التموين)",
      "enriched_text": "النشاط: إنشاء وتشغيل مراكز توزيع البوتاجاز (وزارة التموين) | المصطلحات: مستودع بوتاجاز, توزيع غاز, بتروجاس, أسطوانات معبأة, حماية مدنية, جمالون معدني | أيضاً يسمى: مخزن بوتاجاز, مركز غاز | عند البحث عن: ترخيص مستودع بوتاجاز, فتح مركز توزيع غاز معتمد, توزيع أسطوانات بوتاجاز | الإجراءات: إنشاء وإدارة مستودعات لتخزين وتوزيع أسطوانات غاز البوتاجاز المعبأة (منزلي وتجاري) للمستهلكين وضمان استمرارية الإمداد. | المتطلبات: الموافقة المبدئية (وزارة التموين)، ترخيص إقامة مستودع (بتروجاس)، رخصة مزاولة النشاط (المحليات)، وشهادة الحماية المدنية. | الجهة: وزارة التموين والتجارة الداخلية بالتنسيق مع شركة بتروجاس. | الموقع: مواقع مستقلة ومسورة تلتزم بمسافات الأمان عن الكتلة السكنية. | القانون: قانون التموين رقم 95 لسنة 1945، وقانون الهيئة المصرية العامة للبترول. | الدليل: الدليل- وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية لمراكز التوزيع:\\n1. مواصفات المبنى: أن يكون بدون سقف خرساني (جمالون معدني) للتهوية.\\n2. منظومة الإطفاء: توافر طفايات وخزانات رمل وصناديق حريق مائية.\\n3. التخزين:",
