      "text": "إنشاء محطات خدمة وتموين السيارات (وزارة التموين)",
      "enriched_text": "النشاط: إنشاء محطات خدمة وتموين السيارات (وزارة التموين) | المصطلحات: بنزينة, وقود سائل, غاز طبيعي, تموين سيارات, هيئة البترول, بنزين وسولار, خدمة سيارات | أيضاً يسمى: محطة وقود, محطة تموين | عند البحث عن: ترخيص محطة وقود جديدة, إنشاء بنزينة ومركز خدمة, تموين سيارات بالبنزين والغاز | الإجراءات: إقامة وتشغيل محطات متكاملة لتموين السيارات بالوقود السائل أو الغاز الطبيعي المضغوط، مع تقديم الخدمات الفنية الملحقة (غسيل، زيوت). | المتطلبات: الموافقة المبدئية (وزارة التموين)، ترخيص إقامة (هيئة البترول)، رخصة تشغيل صناعية (IDA)، وشهادة الحماية المدنية. | الجهة: وزارة التموين والتجارة الداخلية بالتنسيق مع الهيئة المصرية العامة للبترول. | الموقع: مواقع مستوفاة للمسافات البينية والقانونية مع الالتزام بالمساحات المقررة. | القانون: قانون التموين رقم 95 لسنة 1945، وقانون الهيئة المصرية العامة للبترول. | الدليل: الدليل - وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية لمحطات الخدمة:\\n1. خزانات الوقود: التأكد من سعة الخزانات ومنظومة كشف التسريب.\\n2. طلمبات التموين: معاينة طلمبات الصرف والتموين الإلكترونية.\\n3. الحماية المدنية:",
