      "enriched_text": "النشاط: إنشاء وتشغيل مدشات الحبوب (وزارة التموين) | المصطلحات: مدشة, جرش الحبوب, طحن حبوب, أعلاف, ذرة وفول, وزارة التموين, تنمية صناعية | أيضاً يسمى: مطحنة جرش, وحدة طحن حبوب, مدشة ذرة | عند البحث عن: ترخيص مدشة حبوب, إنشاء وحدة جرش آلي, طحن الحبوب التموينية | الإجراءات: إقامة وتشغيل وحدات ميكانيكية لجرش وطحن الحبوب المختلفة (ذرة، فول، وغيرها)  . | المتطلبات: الموافقة المبدئية على الموقع (مديرية التموين المختصة)، رخصة تشغيل منشأة (الهيئة العامة للتنمية الصناعية)، شهادة السجل الصناعي (التنمية الصناعية)، وموافقة الهيئة القومية لسلامة الغذاء. | الجهة: وزارة التموين والتجارة الداخلية بالاشتراك مع الهيئة العامة للتنمية الصناعية. | الموقع: المناطق الصناعية أو المواقع المحددة بقرار حماية الأراضي. | القانون: المرسوم بقانون 95 لسنة 1945، وقانون رقم 15 لسنة 2017. | الدليل: الدليل - وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية للمدشات:\\n1. التجهيزات: معاينة وحدات الدش (المطارق) والسيور والفلاتر.\\n2. التخزين: توافر شون مجهزة لاستلام الخام وأخرى للمنتج المعبأ.\\n3. السلامة المهنية:",
