      "enriched_text": "النشاط: إنشاء وتشغيل سويات الموز (وزارة التموين) | المصطلحات: سويات الموز, إنضاج الموز, غاز الإيثيلين, تخمير الموز, وزارة التموين, عزل حراري | أيضاً يسمى: غرف إنضاج الموز, مخمر موز, سوية موز | عند البحث عن: ترخيص سوية موز, إنشاء غرف إنضاج موز, تجارة الموز بالجملة | الإجراءات: إنشاء غرف مخصصة لإنضاج الموز (سويات) . | المتطلبات: موافقة مديرية التموين المختصة على الموقع، رخصة تشغيل منشأة (التنمية الصناعية)، شهادة السجل الصناعي، وشهادة القيد في سجلات سلامة الغذاء. | الجهة: وزارة التموين والتجارة الداخلية (قطاع التجارة الداخلية). | الموقع: داخل الأسواق أو المناطق القريبة من مناطق الإنتاج/الاستهلاك. | القانون: المرسوم بقانون 95 لسنة 1945، وقانون رقم 15 لسنة 2017. | الدليل: دليل - وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية لسويات الموز:\\n1. غرف الإنضاج: التأكد من العزل الحراري التام والحكم ضد تسريب غاز الإيثيلين.\\n2. التحكم البيئي: توافر أجهزة قياس الحرارة والرطوبة.\\n3. السلامة:",
