      "id": "artistic_multimedia_production_comprehensive",
      "text": "نشاط إنتاج المصنفات السمعية والسمعية البصرية والأعمال المتعلقة بها",
      "enriched_text": "النشاط: نشاط إنتاج المصنفات السمعية والسمعية البصرية والأعمال المتعلقة بها | المصطلحات: إنتاج فني, ملكية فكرية, سينما, مسرح, حق مؤلف, قيد تصرفات, CD/DVD | أيضاً يسمى: شركة إنتاج سينمائي, إنتاج محتوى رقمي, صناعة المصنفات | عند البحث عن: ترخيص شركة إنتاج فني, تسجيل حق مؤلف, إنتاج فيلم أو مسرحية | الإجراءات: إنتاج الأفلام السينمائية والتليفزيونية، والفيديو، والكاسيت، والمسرح، وحفلات المنوعات، والمصنفات الرقمية (CD/DVD/Floppy Disks) وما يماثلها. | المتطلبات: ترخيص مزاولة نشاط إنتاج (وزارة الثقافة)، شهادة قيد تصرفات من مكتب حماية حق المؤلف، عقد تأسيس الشركة غرضه الإنتاج الفني، وإيصال سداد الرسوم المقررة. | الجهة: وزارة الثقافة (الإدارة العامة للتراخيص الفنية / قطاع شئون الإنتاج الثقافي). | الموقع: مقر الشركة المرخص لها أو استوديوهات التصوير والإنتاج المعتمدة، مع الالتزام بقيد المصنف في سجلات الوزارة. | القانون: قانون حماية حقوق الملكية الفكرية رقم 82 لسنة 2002، والقانون رقم 430 لسنة 1955 بشأن تنظيم الرقابة على المصنفات. | الدليل: دليل تراخيص وزارة الثقافة - الإدارة العامة للتراخيص الفنية. | ملاحظات فنية: اشتراطات دقة الإنتاج:\\n١. سجل قيد التصرفات: تلتزم الشركة بقيد كل مصنف.\\n٢. الرقابة: يخضع السيناريو للمراجعة قبل الإنتاج.\\n٣. الحقوق المجاورة: الالتزام بحماية أداء الفنانين.\\n٤. التوثيق:",
