      "id": "artistic_distribution_and_trade",
      "text": "نشاط توزيع أو بيع أو تأجير المصنفات السمعية والسمعية البصرية (أفلام/كاسيت/فيديو)",
      "enriched_text": "النشاط: نشاط توزيع أو بيع أو تأجير المصنفات السمعية والسمعية البصرية (أفلام/كاسيت/فيديو) | المصطلحات: توزيع أفلام, بيع كاسيت, تأجير فيديو, هولوجرام, موزع فني, وزارة الثقافة, حقوق التوزيع | أيضاً يسمى: تجارة المصنفات الفنية, وكالة توزيع سينمائي, منفذ بيع كاسيت | عند البحث عن: ترخيص موزع فني, بيع أسطوانات أفلام, فتح محل تأجير فيديوهات | الإجراءات: توزيع أو بيع الأفلام السينمائية، التليفزيونية، الفيديو، الكاسيت، المسرحيات، المصنفات الرقمية (CD/DVD)، وتأجير شرائط الفيديو وما يماثلها. | المتطلبات: ترخيص مزاولة نشاط توزيع/بيع (وزارة الثقافة)، بيان بالمصنفات المراد تداولها، شهادة قيد تصرفات تثبت حق التوزيع، وإيصال سداد الرسوم الإدارية. | الجهة: وزارة الثقافة (الإدارة العامة للتراخيص الفنية) ومكتب حماية حق المؤلف. | الموقع: المحال التجارية، شركات التوزيع، أو منافذ البيع. | القانون: قانون حماية حقوق الملكية الفكرية رقم 82 لسنة 2002، والقانون 430 لسنة 1955. | الدليل: دليل تراخيص وزارة الثقافة - قطاع شئون الإنتاج الثقافي. | ملاحظات فنية: اشتراطات دقة التوزيع والبيع:\\n١. مصدر المصنف: يجب أن تكون النسخ أصلية.\\n٢. قيد التصرفات: وجود عقد توزيع موثق.\\n٣. الملصق الرقابي: الالتزام بالهولوجرام على كل نسخة.\\n٤. السجلات:",
