      "text": "نشاط نسخ الأفلام السينمائية والتليفزيونية والفيديو والكاسيت والمصنفات السمعية والبصرية",
      "enriched_text": "النشاط: نشاط نسخ الأفلام السينمائية والتليفزيونية والفيديو والكاسيت والمصنفات السمعية والبصرية | المصطلحات: نسخ مصنفات, معمل نسخ, أمر نسخ, هولوجرام, ملكية فكرية, وزارة الثقافة | أيضاً يسمى: طباعة أفلام, مضاعفة وسائط فنية, إنتاج نسخ تجارية | عند البحث عن: ترخيص معمل نسخ رقمي, أمر نسخ أفلام, حق نسخ مصنف | الإجراءات: عمليات تكرار واستخراج نسخ متعددة من المصنفات الفنية (أفلام، كاسيت، أقراص مدمجة) من النسخة الأصلية (Master) لطرحها للتداول. | المتطلبات: ترخيص مزاولة نشاط نسخ (وزارة الثقافة)، شهادة قيد تصرفات تبيح الحق في النسخ، ترخيص الرقابة على النسخة الأصلية، وإيصال سداد الرسوم المقررة عن كل نسخة. | الجهة: وزارة الثقافة (الإدارة العامة للتراخيص الفنية) ومكتب حماية حق المؤلف. | الموقع: معامل النسخ المعتمدة، المطابع الفنية، أو وحدات النسخ الرقمي. | القانون: المادة 185 من القانون رقم 82 لسنة 2002، والقانون رقم 430 لسنة 1955. | الدليل: دليل تراخيص وزارة الثقافة - قطاع شئون الإنتاج الثقافي. | ملاحظات فنية: اشتراطات دقة النسخ:\\n١. النسخة الأصلية: تقديم ",
