      "text": "نشاط تحويل المصنفات السمعية والسمعية البصرية (من وسيط إلى آخر)",
      "enriched_text": "النشاط: نشاط تحويل المصنفات السمعية والسمعية البصرية (من وسيط إلى آخر) | المصطلحات: تحويل وسائط, أفلام ديجيتال, كاسيت لسي دي, وزارة الثقافة, معالجة تقنية | أيضاً يسمى: نقل تنسيق فني, تحويل وسائط تخزين, تغيير وعاء المصنف | عند البحث عن: ترخيص تحويل أفلام قديمة, تحويل وسائط رقمية, تراخيص معامل التحويل | الإجراءات: عمليات تغيير وعاء أو وسيط المصنف الفني (مثل التحويل من فيلم سينمائي إلى ديجيتال، أو من شريط كاسيت إلى CD) أو أي وسائط تقنية مستحدثة. | المتطلبات: ترخيص مزاولة نشاط تحويل (وزارة الثقافة)، شهادة قيد تصرفات تمنح الحق في التحويل، موافقة الرقابة على النسخة الأصلية، وإيصال سداد رسوم التحويل المقررة. | الجهة: وزارة الثقافة (الإدارة العامة للتراخيص الفنية) ومكتب حماية حق المؤلف. | الموقع: معامل التحويل الرقمي أو السينمائي المعتمدة. | القانون: قانون حماية حقوق الملكية الفكرية رقم 82 لسنة 2002، والقانون رقم 430 لسنة 1955. | الدليل: دليل تراخيص وزارة الثقافة - قطاع شئون الإنتاج الثقافي. | ملاحظات فنية: اشتراطات دقة التحويل:\\n١. سلامة الأصل: إثبات ملكية النسخة الأصلية.\\n٢. عدم التعديل: التحويل فقط دون مونتاج للمحتوى.\\n٣. التوثيق: ذكر نوع الوسيط الجديد في السجل.\\n٤. الحماية:",
