      "text": "نشاط تسجيل المصنفات السمعية والسمعية البصرية والبرامج الإذاعية",
      "enriched_text": "النشاط: نشاط تسجيل المصنفات السمعية والسمعية البصرية والبرامج الإذاعية | المصطلحات: تسجيل إذاعي, ألحان, أداء صوتي, حقوق مجاورة, استوديو تسجيل, وزارة الثقافة | أيضاً يسمى: إنتاج إذاعي, تسجيل موسيقي, خدمات استوديو | عند البحث عن: ترخيص تسجيل إذاعي, تسجيل أغنية رسمياً, فتح استوديو تسجيل ألحان | الإجراءات: تسجيل الأداء الصوتي، الألحان، الأغاني، البرامج الإذاعية، والتسجيلات الموسيقية بكافة أشكالها على وسائط سمعية أو رقمية. | المتطلبات: ترخيص مزاولة نشاط تسجيل (وزارة الثقافة)، شهادة قيد تصرفات للأداء أو اللحن، عقد ملكية أو إيجار الاستوديو، وإيصال سداد الرسوم. | الجهة: وزارة الثقافة (الإدارة العامة للتراخيص الفنية) ومكتب حماية حق المؤلف. | الموقع: استوديوهات التسجيل الصوتي المجهزة والمعزولة. | القانون: قانون حماية حقوق الملكية الفكرية رقم 82 لسنة 2002، والقانون رقم 430 لسنة 1955. | الدليل: دليل تراخيص وزارة الثقافة - قطاع شئون الإنتاج الثقافي. | ملاحظات فنية: اشتراطات دقة التسجيل:\\n١. حقوق الأداء: تقديم مستندات تثبت تصرفات الأداء.\\n٢. التجهيز: استوديو مزود بأجهزة تسجيل مرخصة.\\n٣. السجل: مسك سجل لقيد الأعمال المسجلة.\\n٤. الرقابة:",
