      "id": "cinema_import_export_international",
      "text": "نشاط الاستيراد والتصدير السينمائي وتسهيلات حركة المعدات والمصنفات الدولية",
      "enriched_text": "النشاط: نشاط الاستيراد والتصدير السينمائي وتسهيلات حركة المعدات والمصنفات الدولية | المصطلحات: استيراد أفلام, تصدير أفلام, مركز قومي للسينما, معدات سينمائية, إدخال مؤقت, جمارك | أيضاً يسمى: تجارة أفلام دولية, شحن معدات سينما, توزيع دولي للأفلام | عند البحث عن: تصريح استيراد فيلم أجنبي, تصدير فيلم مصري, إدخال معدات تصوير أجنبية | الإجراءات: إدارة عمليات استيراد الأفلام الأجنبية (نسخ العرض)، تصدير الأفلام المصرية للخارج، استيراد المعدات السينمائية للاستخدام الخاص، وتسهيل الإدخال المؤقت لمعدات فرق العمل الأجنبية. | المتطلبات: ترخيص مزاولة نشاط (ساري)، تصريح استيراد/تصدير من المركز القومي للسينما، شهادة الإجراءات الجمركية، موافقة الرقابة على المصنفات. | الجهة: المركز القومي للسينما (الإدارة العامة للاستيراد والتصدير) بالتنسيق مع مصلحة الجمارك والرقابة على المصنفات. | الموقع: مقر شركة الاستيراد والتصدير المرخصة، والمنافذ الجمركية. | القانون: القرارات الوزارية المشتركة، وقانون الجمارك، واللائحة الداخلية للمركز القومي للسينما. | الدليل: دليل الإدارة العامة للاستيراد والتصدير - المركز القومي للسينما. | ملاحظات فنية: اشتراطات دقة التشغيل:\\n١. مطابقة البوليصة: توافق البيانات مع طلب الاستيراد.\\n٢. الغرض: التمييز بين العرض العام والاستخدام الخاص للمعدات.\\n٣. الدورة الرقابية:",
