      "text": "تراخيص أنشطة سوق الغاز",
      "enriched_text": "النشاط: تراخيص أنشطة سوق الغاز | المصطلحات: سوق الغاز, GasReg, كود الشبكة, شحن الغاز, توريد الغاز, الشبكة القومية للغازات | أيضاً يسمى: تجارة الغاز, توزيع الغاز المسال, تراخيص جهاز الغاز | عند البحث عن: ترخيص شحن غاز, ترخيص توريد غاز للمصانع, إقامة تسهيلات غاز مسال | الإجراءات: أنشطة سوق الغاز: تشمل تشغيل شبكات وتسهيلات الغاز، شحن الغاز عبر الشبكة القومية، توريد الغاز للمستهلكين، وإقامة أو إدارة محطات استقبال وإعادة تغاز الغاز المسال. | المتطلبات: الحصول على ترخيص مزاولة النشاط من جهاز تنظيم أنشطة سوق الغاز والالتزام بكود الشبكة (Network Code). | الجهة: جهاز تنظيم أنشطة سوق الغاز (GasReg) - وزارة البترول. | الموقع: تسهيلات الاستقبال، شبكة الخطوط القومية، ومراكز التوزيع المعتمدة. | القانون: - القانون رقم 196 لسنة 2017 بإصدار قانون تنظيم أنشطة سوق الغاز. | الدليل: دليل جهاز تنظيم أنشطة سوق الغاز | ملاحظات فنية: يوصى بالتركيز على النقاط الفنية التالية:\\n1. مطابقة التسهيلات: قدرة المنشأة على الاستقبال والشحن.\\n2. معايير HSE: مراجعة نظم الإطفاء التلقائي وصمامات الأمان.\\n3. التوافق مع كود الشبكة:",
