      "id": "mining",
      "text": "أنشطة الثروة المعدنية والتعدين (EMRA)",
      "enriched_text": "النشاط: أنشطة الثروة المعدنية والتعدين (EMRA) | المصطلحات: تعدين, مناجم, محاجر, ثروة معدنية, خامات, استخراج, ملاحات, هيئة الثروة المعدنية | أيضاً يسمى: تنقيب, استغلال مناجم, كسارات | عند البحث عن: ترخيص منجم, البحث عن خامات معدنية, استغلال محجر | الإجراءات: أنشطة الثروة المعدنية: تشمل البحث والاستغلال للمناجم والمحاجر والملاحات، واستخراج الخامات المعدنية والمنجمية بكافة أنواعها. | المتطلبات: الحصول على ترخيص (بحث أو استغلال) من الهيئة المصرية العامة للثروة المعدنية بعد القيد في سجل الشركات المؤهلة. | الجهة: وزارة البترول والثروة المعدنية - الهيئة المصرية العامة للثروة المعدنية (EMRA). | الموقع: مناطق الامتياز المحددة بإحداثيات دقيقة (WGS84)، ويحظر العمل في المناطق العسكرية أو الأثرية دون موافقات خاصة. | القانون: - القانون رقم 198 لسنة 2014 بإصدار قانون الثروة المعدنية. \\n- القانون رقم 145 لسنة 2019 بتعديل بعض أحكام قانون الثروة المعدنية. \\n- اللائحة التنفيذية الصادرة بقرار رئيس مجلس الوزراء رقم 108 لسنة 2020. | الدليل: دليل خدمات المستثمرين في صناعة التعدين | ملاحظات فنية: يوصى بالتركيز على الضوابط الفنية الميدانية التالية عند معاينة مواقع المناجم والمحاجر:\\n1. علامات التحديد (Pillars): التأكد من وضع علامات حدودية ثابتة.\\n2. إجراءات السلامة بالمنجم:",
