      "text": "أنشطة إنتاج وتوزيع الكهرباء (EgyptEra)",
      "enriched_text": "النشاط: أنشطة إنتاج وتوزيع الكهرباء (EgyptEra) | المصطلحات: كهرباء, توليد طاقة, توزيع كهرباء, محطة قوى, مرفق الكهرباء, طاقة متجددة, عدادات ذكية | أيضاً يسمى: إنتاج طاقة كهربائية, بيع كهرباء, مشغل شبكة كهرباء | عند البحث عن: ترخيص إنتاج كهرباء, إنشاء محطة توليد طاقة, توزيع الكهرباء للمشتركين | الإجراءات: أنشطة الكهرباء: تشمل إنتاج (توليد) الطاقة الكهربائية من مصادر تقليدية أو متجددة، ونقل وتوزيع الكهرباء، وبيعها للمستهلكين، وإدارة وصيانة محطات القوى. | المتطلبات: الحصول على تصريح (للبدء في الإنشاء) ثم ترخيص (لمزاولة النشاط) من جهاز تنظيم مرفق الكهرباء وحماية المستهلك. | الجهة: جهاز تنظيم مرفق الكهرباء وحماية المستهلك (EgyptEra). | الموقع: مواقع محطات التوليد، مسارات الشبكات، ومحطات المحولات، مع ضرورة الالتزام بحرم الخطوط الكهربائية والمعايير الإنشائية. | القانون: - قانون الكهرباء رقم 87 لسنة 2015. \\n- اللائحة التنفيذية لقانون الكهرباء الصادرة بقرار وزير الكهرباء رقم 230 لسنة 2016. | الدليل: دليل جهاز تنظيم مرفق الكهرباء وحماية المستهلك | ملاحظات فنية: يوصى بالتركيز على الضوابط الفنية والأمنية التالية عند معاينة منشآت الكهرباء:\\n1. كفاءة الربط بالشبكة: مطابقة نقطة الربط للأكواد الفنية.\\n2. أنظمة الحماية والإطفاء:",
