      "enriched_text": "النشاط: تأهيل شركات أنظمة الخلايا الشمسية (NREA) | المصطلحات: طاقة شمسية, NREA, خلايا ضوئية, تأهيل شركات, صافي القياس, ألواح شمسية, طاقة متجددة | أيضاً يسمى: أنظمة الطاقة الشمسية, تركيب ألواح شمسية, شركات الطاقة المتجددة | عند البحث عن: تأهيل شركة طاقة شمسية, اعتماد هيئة الطاقة الجديدة والمتجددة, تركيب محطة شمسية مرتبطة بالشبكة | الإجراءات: تأهيل الشركات العاملة في مجال تركيبات أنظمة الخلايا الشمسية المرتبطة بالشبكة للقدرات حتى 20 ميجاوات، ويشمل ذلك التصميم والتنفيذ والصيانة والتشغيل. | المتطلبات: تقديم سجل تجاري حديث، بطاقة ضريبية، سابقة أعمال مدعمة بالعقود، قوائم مالية معتمدة، شهادة تأمينات للعاملين. | الجهة: هيئة تنمية واستخدام الطاقة الجديدة والمتجددة (NREA). | الموقع: تطبق الاشتراطات على الشركات الراغبة في العمل بمشروعات الخلايا الشمسية في كافة المواقع المخصصة. | القانون: قانون رقم 102 لسنة 1986 بشأن إنشاء هيئة الطاقة الجديدة والمتجددة وتعديلاته. | الدليل: دليل هيئة تنمية واستخدام الطاقة الجديدة والمتجددة لتأهيل شركات الخلايا الشمسية | ملاحظات فنية: توصيات المعاينة والتدقيق الفني لشركات الطاقة الشمسية:\\n1. جودة المكونات: مطابقة الألواح للمواصفات القياسية الدولية (IEC).\\n2. الكفاءة البشرية: مراجعة أعداد المهندسين والفنيين المسجلين.\\n3.",
