      "enriched_text": "النشاط: إنشاء وتشغيل مضارب وفراكات الأرز (وزارة التموين) | المصطلحات: أرز, مضرب أرز, تبييض أرز, أرز شعير, وزارة التموين, Color Sorter, سلعة استراتيجية | أيضاً يسمى: فراكة أرز, تجهيز الأرز الأبيض, مصنع ضرب الأرز | عند البحث عن: إنشاء مضرب أرز, ترخيص فراكة أرز, تجهيز أرز تمويني | الإجراءات: إنشاء وتشغيل مضارب وفراكات الأرز لتحويل الأرز الشعير إلى أرز أبيض (تبييض، تلميع، وفرز)، لضمان توفير السلعة الاستراتيجية للمنظومة التموينية والأسواق. | المتطلبات: الموافقة المبدئية على البدء في إجراءات الإنشاء (وزارة التموين)، رخصة تشغيل منشأة صناعية (الهيئة العامة للتنمية الصناعية)، شهادة السجل الصناعي المعتمدة (الهيئة العامة للتنمية الصناعية)، والموافقة الفنية النهائية على مزاولة النشاط (وزارة التموين والتجارة الداخلية). | الجهة: وزارة التموين والتجارة الداخلية بالتعاون مع الهيئة العامة للتنمية الصناعية. | الموقع: المناطق الصناعية أو المواقع المستوفاة لاشتراطات حماية الأراضي، مع ضرورة القرب من مناطق زراعة الأرز وتوفر مساحات كافية للتخزين (شون) وموازين البسكول. | القانون: قانون التموين رقم 95 لسنة 1945، قانون المنشآت الصناعية رقم 15 لسنة 2017، والقرارات الوزارية المنظمة لتداول الأرز. | الدليل: الدليل الإرشادي للمشروعات التجارية التموينية - وزارة التموين | ملاحظات فنية: اشتراطات المعاينة الفنية للمضارب والفراكات:\\n1. خطوط الإنتاج: معاينة وحدات تبييض الأرز، والفرز الآلي (Color Sorter)، ووحدات تلميع.\\n2. الصرف الصناعي: التأكد من التخلص الآمن من السرسة والرجيع.\\n3.",
