      "enriched_text": "النشاط: إنشاء الجامعات الخاصة والأهلية (وزارة التعليم العالي) | المصطلحات: جامعة خاصة, جامعة أهلية, تعليم عالي, مجلس الجامعات, بحث علمي, قرار جمهوري, كليات | أيضاً يسمى: مؤسسة تعليم عالي خاصة, جامعة غير هادفة للربح | عند البحث عن: إنشاء جامعة خاصة, تراخيص التعليم العالي, تأسيس جامعة أهلية | الإجراءات: إنشاء الجامعات الخاصة والأهلية لتقديم خدمات التعليم العالي والبحث العلمي، مع اشتراط كفاية رأس المال لتجهيز الجامعة ومزاولة نشاطها. | المتطلبات: تقديم طلب عبر وكيل المؤسسين، دراسة جدوى فنية ومالية، بيان بأسماء المؤسسين وجنسياتهم، رسومات هندسية تفصيلية، وإيداع الحصص النقدية في بنك محلي معتمد. | الجهة: وزارة التعليم العالي (أمانة مجلس الجامعات الخاصة والأهلية). | الموقع: تخصيص أرض بمساحة تتناسب مع عدد الكليات المقترحة. | القانون: - قانون الجامعات الخاصة والأهلية رقم 12 لسنة 2009. | الدليل: دليل إجراءات إنشاء الجامعات الخاصة والأهلية | ملاحظات فنية: الضوابط الفنية:\\n1. الكفاية الإنشائية: صلاحية المباني والمرافق التعليمية.\\n2. المقومات البشرية: توفر أعضاء هيئة التدريس بالنسب المقررة.\\n3. التجهيزات المعملية: حداثة الأجهزة ومطابقتها للمناهج.\\n4.",
