      "id": "private_international_schools",
      "text": "إنشاء المدارس الخاصة والدولية (الهيئة العامة للأبنية التعليمية)",
      "enriched_text": "النشاط: إنشاء المدارس الخاصة والدولية (الهيئة العامة للأبنية التعليمية) | المصطلحات: مدرسة خاصة, مدرسة دولية, أبنية تعليمية, تعليم أساسي, تراخيص مدارس, معايير تربوية | أيضاً يسمى: منشأة تعليمية خاصة, مدرسة لغات, أبنية مدرسية | عند البحث عن: بناء مدرسة خاصة, ترخيص مدرسة دولية, معايير الأبنية التعليمية | الإجراءات: إنشاء المدارس الخاصة والدولية: يشمل تخطيط وتصميم وتنفيذ المباني المدرسية وفقاً للمعايير التربوية والهندسية. | المتطلبات: تقديم طلب معاينة موقع، مستندات الملكية، خريطة مساحية 1:1000، الرسومات المعمارية، وموافقة جهات الولاية. | الجهة: الهيئة العامة للأبنية التعليمية (GAEB). | الموقع: مواقع المدارس داخل أو خارج الحيز العمراني بشرط الالتزام بمسافات البعد عن مصادر التلوث. | القانون: قرار رئيس الجمهورية رقم 448 لسنة 1988، والمعايير الفنية للأبنية التعليمية 2025. | الدليل: دليل معايير واشتراطات صلاحية المواقع والمباني المدرسية | ملاحظات فنية: الاشتراطات الفنية:\\n1. صلاحية الموقع: البعد عن خطوط الضغط العالي والسكك الحديدية.\\n2. نصيب الطالب: توفر مساحة الأرض اللازمة (5.4 م2/طالب).\\n3. الأفنية: ضرورة توفر فناء فسحة وتربية رياضية.\\n4. الإتاحة:",
