      "enriched_text": "النشاط: وحدات طعام متنقلة   | المصطلحات: عربة طعام, Food Truck, سلامة الغذاء, طعام متنقل, ترخيص تداول غذاء, وجبات سريعة | أيضاً يسمى: عربة وجبات, وحدة طعام متنقلة, فود تراك | عند البحث عن: ترخيص عربة طعام متنقلة, فتح مشروع فود تراك, اشتراطات سلامة الغذاء للعربات | الإجراءات: وحدات الطعام المتنقلة: تشمل العربات، المقطورات، أو أي وحدات أخرى مجهزة لتداول الأغذية وتنتقل من مكان لآخر. | المتطلبات: ترخيص تداول الغذاء لوحدات الطعام المتنقلة. | الجهة: الهيئة القومية لسلامة الغذاء (NFSA). | الموقع: الأماكن المحددة من قبل المحليات بعيداً عن مصادر التلوث. | القانون: القانون رقم 1 لسنة 2017، والقانون رقم 207 لسنة 2017. | الدليل: دليل هيئة سلامة الغذاء | ملاحظات فنية: الاشتراطات الصحية:\\n1. خامات الوحدة: مواد غير قابلة للصدأ (استانلس ستيل).\\n2. كفاءة الأسطح: ملساء تماماً وسهلة التنظيف.\\n3. مصادر المياه: توفر خزان مياه شرب (Food Grade).\\n4. الصرف:",
