      "id": "public_food_establishments_nfsa",
      "text": "ترخيص تداول الغذاء للمحال العامة",
      "enriched_text": "النشاط: ترخيص تداول الغذاء للمحال العامة | المصطلحات: مطعم, كافيه, سوبر ماركت, بقالة, سلامة الغذاء, قانون المحال العامة, تداول الغذاء | أيضاً يسمى: منشأة غذائية ثابتة, محل عام غذائي | عند البحث عن: ترخيص مطعم سلامة الغذاء, فتح سوبر ماركت مرخص, اشتراطات تداول الغذاء | الإجراءات: تداول الغذاء في المحال العامة: يشمل المطاعم، الكافيهات، السوبر ماركت، البقالة، وأي منشأة ثابتة تقوم بتحضير أو بيع المواد الغذائية. | المتطلبات: الحصول على ترخيص تداول الغذاء من الهيئة القومية لسلامة الغذاء. | الجهة: الهيئة القومية لسلامة الغذاء (NFSA). | الموقع: في الموقع المرخص للمحل العام بعيداً عن مصادر التلوث. | القانون: القانون رقم 1 لسنة 2017، والقانون رقم 154 لسنة 2019. | الدليل: دليل ترخيص تداول الغذاء للمحال العامة | ملاحظات فنية: الاشتراطات الفنية:\\n1. التصميم الداخلي: منع التلوث الخلطي (Cross-contamination).\\n2. الأسطح: ملساء غير ماصة وسهلة التطهير.\\n3. المياه والصرف: إمدادات مياه كافية ونظام صرف يمنع الارتداد.\\n4.",
