      "enriched_text": "النشاط: ترخيص نقل مخلفات المستحضرات والمستلزمات الطبية | المصطلحات: نقل مخلفات, مخلفات طبية, جهاز شئون البيئة, سيارات مجهزة, حماية مدنية, نقل خطر | أيضاً يسمى: شركة نقل نفايات طبية, لوجستيات مخلفات طبية | عند البحث عن: ترخيص سيارات نقل مخلفات طبية, موافقة البيئة لنقل المخلفات, جراج سيارات مخلفات طبية | الإجراءات: عمليات جمع ونقل مخلفات المستحضرات والمستلزمات الطبية من أماكن تولدها إلى المنشآت المرخص لها بالإدارة المتكاملة. | المتطلبات: الموافقة البيئية (وزارة البيئة)، موافقة الحماية المدنية على الجراج، رخصة مهنية، وموافقة هيئة الدواء. | الجهة: هيئة الدواء المصرية (الإدارة المركزية للعمليات - وحدة الإدارة المتكاملة للمخلفات). | الموقع: مقر إداري وجراج مخصص لمبيت السيارات بموافقة الحماية المدنية. | القانون: قانون 151 لسنة 2019، قانون 202 لسنة 2020 (إدارة المخلفات)، وقانون البيئة رقم 4 لسنة 1994. | الدليل: تراخيص منشات الادارة المتكاملة لمخلفات المستحضرات والمستلمات الطيبة | ملاحظات فنية: اشتراطات النقل:\\n١. جهات الاعتماد: موافقة (جهاز شئون البيئة) شرط أساسي.\\n٢. اشتراطات السيارات: مجهزة، مغلقة، ومخصصة حصراً للنشاط.\\n٣. قاعدة الاختلاط: المخلفات المختلطة تعامل كـ (مخلفات خطرة).\\n٤.",
