      "enriched_text": "النشاط: ترخيص معالجة مخلفات المستحضرات والمستلزمات الطبية | المصطلحات: معالجة مخلفات, تدوير مخلفات, هيئة الدواء, تنمية صناعية, تخلص بيئي, مخلفات خطرة | أيضاً يسمى: محطة معالجة نفايات طبية, فرز وتدوير مخلفات طبية | عند البحث عن: ترخيص محطة معالجة مخلفات طبية, إنشاء مصنع تدوير نفايات طبية, موافقة البيئة للمعالجة | الإجراءات: القيام بالعمليات الفنية التي تشمل فرز وفصل وتدوير مخلفات المستحضرات والمستلزمات الطبية بهدف تقليل حجمها أو خطورتها. | المتطلبات: موافقة جهاز شئون البيئة، رخصة تشغيل (التنمية الصناعية)، اعتماد نقابة المهندسين، وتعيين مدير مسؤول. | الجهة: هيئة الدواء المصرية (وحدة الإدارة المتكاملة لمخلفات المستحضرات). | الموقع: منشأة معالجة ثابتة تشتمل على مساحات فرز وتخزين مطابقة للاشتراطات المكانية. | القانون: قانون 151 لسنة 2019، قانون 202 لسنة 2020، وقانون 15 لسنة 2017 (تيسير التراخيص). | الدليل: الدليل التنظيمي لتراخيص منشآت الإدارة المتكاملة للمخلفات | ملاحظات فنية: اشتراطات المعالجة:\\n١. التغيير الفني: تحويل المواد الخطرة لشكل آمن.\\n٢. قاعدة الاختلاط: الشحنة المختلطة تعامل كخطرة بالكامل.\\n٣. التخلص النهائي: عقد سارٍ مع مدفن صحي معتمد.\\n٤. التفتيش:",
