      "text": "مكتب علمي    ",
      "enriched_text": "النشاط: مكتب علمي     | المصطلحات: مكتب علمي, دعاية طبية, عينات مجانية, هيئة الدواء, نشرات علمية, تسجيل مستورد, اتحاد المهن الطبية | أيضاً يسمى: مكتب دعاية طبية, وكيل علمي لشركة أدوية | عند البحث عن: ترخيص مكتب علمي, دعاية للمستحضرات الطبية, فتح مخزن عينات أدوية | الإجراءات: القيام بأعمال الدعاية للمستحضرات الطبية والمستلزمات والكيماويات الدوائية، ويجوز له التسجيل للمستحضرات المستوردة باسمه ولحسابه. | المتطلبات: ترخيص مكتب علمي (EDA)، مدير من أعضاء اتحاد المهن الطبية، وجود صيدلي مسؤول متفرغ لمخزن العينات. | الجهة: الإدارة العامة لتراخيص المكاتب العلمية والمخازن بهيئة الدواء المصرية. | الموقع: مقر المكتب العلمي ومخزن العينات (الحد الأدنى 25 م² للمخزن). | القانون: قانون رقم 127 لسنة 1955 في شأن مزاولة مهنة الصيدلة. | الدليل: دليل تراخيص المكاتب العلمية | ملاحظات فنية: 1. المدير: من أعضاء اتحاد المهن الطبية.\\n2. الصيدلي: مسؤول متفرغ لمخزن العينات.\\n3. المساحة: مخزن العينات لا يقل عن 25 م² صافي.\\n4. البيئة: أجهزة تسجيل الحرارة (داتا لوجر).\\n5. الحيازة:",
